import menu from './hamburger.svg';
import './Menu.css'

function Menu(props) {
    return (
        <div class={props.class}>
            <img src={menu} widht={props.width} height={props.height} className="hamburger" alt="menu" />
        </div>
    );
};

export default Menu;
